import { makeStyles } from "@material-ui/core";

export const useStyles = makeStyles((theme) => ({
    root: {
        borderBottom: '1px solid #a4b0be',
        color: 'white',
        padding: '10px 0'
    },
    title: {
        flexGrow: 1,
        textTransform: 'uppercase',
        fontSize: '28px',
        letterSpacing: '0.5px',
        ...theme.typography.antonio,
    }
}));
